import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import ReactDetail from "./pages/TechDetail/ReactDetail";
import JavaDetail from "./pages/TechDetail/JavaDetail";
import PythonDetail from "./pages/TechDetail/PythonDetail";
import Footer from "./components/Footer";
// import TechDetail from "./pages/TechDetail";  // we'll create this next

const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/tech/react" element={<ReactDetail />} />
         <Route path="/tech/java" element={<JavaDetail />} />
        <Route path="/tech/python" element={<PythonDetail />} />
        {/* <Route path="/tech/:techName" element={<TechDetail />} /> */}
      </Routes>
      <Footer />
    </Router>
  );
};

export default App;
